import React, { useEffect, useState } from 'react'

function App() {

  const [jsonF, setJsonF] = useState([{}]);

  useEffect(() => {
    fetch("/json").then(response => response.json()).then(data => {setJsonF(data)});
    console.log("fetch successful");
  }, []);

  return (
    <div>
      <p> {jsonF} </p>
    </div>
  )
}

export default App
